Метафі́зика (грец. Τά μετά τά φυσικά — «те, що понад фізикою», лат. metaphysica) — галузь філософії, розглядає буття як буття, досліджує граничні й надчуттєві принципи, причини та засади буття. Термін «метафізика» походить від сполучення грецьких μετά (metá) (по, понад, поза) і φυσικά (фізика). Таку назву в I столітті до н. е. дав працям Арістотеля, що не потрапили до твору «Фізика», його учень Андронік з острова Родос. Термін метафізика часто використовується у філософії, однак, різні філософи вкладають у нього різне значення, розширюючи або звужуючи область його застосування. При різному трактуванні терміну змінюється ставлення до нього. Тому значення терміну дуже сильно залежить від контексту: 
* Метафізика — це вчення про надчуттєві, недоступні досвідові принципи і початок буття (існування світу); 
* Метафізика — це синонім філософії; 
* Метафізика в переносному розумінні (буденному) вживається для позначення чогось абстрактного, малозрозумілого, умоспоглядального; 
* Метафізика — це наука про речі, спосіб з'ясування світоглядних питань (сенс життя — основне питання філософії тощо), які не піддаються осягненню за допомогою експерименту та методів конкретних наук; 
* Метафізика — це концепція розвитку, метод пізнання, альтернативний діалектиці. В значенні «антидіалектика» термін «метафізика» запровадив у філософію Геґель.
